INSERT INTO `ps_condition` VALUES(9, 9, 'sql', 'SELECT COUNT(*) FROM PREFIX_carrier WHERE name NOT IN (\"0\", \"My carrier\")', '>', '1', '2', 'hook', 'actionObjectCarrierAddAfter', 1, '2023-01-11 19:28:12', '2023-01-11 19:28:12');
